import './App.css';
import { Switch, Route, NavLink } from 'react-router-dom'
import { Login } from '../components/login'

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/login" component={Login} />
        <Route path="/register" component={Register} />
        <Route path="/main" component={Main} />
        <Route path="/vote/:id" />

      </Switch>
    </div>
  );
}

export default App;
